// css
import "../assets/scss/header.scss";

import React, { Component } from "react";

export const Head = (
  title,
  linkName1,
  link1,
  linkName2,
  link2,
  linkName3,
  link3,
  imageLink,
  image
) => {
  return (
    <header className="header">
      <div className="header-content">
        <h1>{title}</h1>
        <ul>
          <li className="active">
            <a href={link1}>{linkName1}</a>
          </li>
          <li className="active">
            <a href={link2}>{linkName2}</a>
          </li>
          <li className="active">
            <a href={link3}>{linkName3}</a>
          </li>
          <a href={imageLink} target="_blank" className="appstore-badge">
            <img
              alt="Download button that leads to the App Store"
              src={image}
            />
          </a>
        </ul>
      </div>
    </header>
  );
};

class Header extends React.Component {
  state = {};
  componentDidMount() {}

  render() {
    return (
      <header className="header">
        <div className="header-content">
          <h1>UniU</h1>
          <ul>
            <li className="active">
              <a href="\">Scopri</a>
            </li>
            <li>
              {" "}
              <a href="\">Contatti</a>
            </li>
            <li>
              <a href="\">Termini & Condizioni</a>
            </li>
            <a href="\" target="_blank" className="appstore-badge">
              <img
                alt="Download button that leads to the App Store"
                src={require("../assets/img/appstore-badge.svg")}
              />
            </a>
          </ul>
        </div>
      </header>
    );
  }
}
